<?phpnamespace DoctorScript\Router\Service;use DoctorScript\ServiceManager\ServiceFactoryInterface;use DoctorScript\ServiceManager\ServiceLocatorInterface;use DoctorScript\Router\RouterInterface;use DoctorScript\Router\Regex;use DoctorScript\Router\RouteMatch;class RegexRouterFactory implements ServiceFactoryInterface{    /**     * Create Regex router and inject appropriate dependencies     *     * @param  ServiceLocatorInterface $serviceLocator     * @return RouterInterface;    */    public function createService(ServiceLocatorInterface $serviceLocator)    {        $router = new Regex();        $router->setRouteMatch(new RouteMatch());                return $router;    }}